question.query:
PREFIX dc: <http://purl.org/dc/elements/1.1/>
PREFIX mm: <http://musicbrainz.org/mm/mm-2.1#>
SELECT DISTINCT ?artist ?artistname
WHERE {
  ?artist mm:artistType mm:TypeGroup .
 {?artist mm:beginDate ?date .
  FILTER (?date <= '2010-12-31'^^xsd:date && ?date >= '2010-01-01'^^xsd:date) }
 UNION 
 {?artist mm:beginDate ?date .
  FILTER regex(?date,'2010') }
  ?artist dc:title ?artistname .
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX mm: <http://musicbrainz.org/mm/mm-2.1#>
SELECT COUNT(DISTINCT ?artist) 
WHERE {
    ?artist rdf:type mm:Artist .
    ?artist mm:artistType mm:TypePerson .
  { ?artist mm:beginDate ?date .
    FILTER ( ?date <= '1966-12-31'^^xsd:date && ?date >= '1966-01-01'^^xsd:date ) }
  UNION 
  { ?artist mm:beginDate ?date .
    FILTER regex(?date,'1966') }
}

PREFIX mm: <http://musicbrainz.org/mm/mm-2.1#>
PREFIX dc: <http://purl.org/dc/elements/1.1/>
SELECT COUNT(DISTINCT ?artist) {
  ?artist mm:artistType mm:TypeGroup .
  ?artist dc:title 'Queen' .
}
